import React from 'react'
import { View, Text,StyleSheet,StatusBar } from 'react-native'


const layout = ({ children }) => {
    return (
        <View style={styles.container}>
            {children}
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        backgroundColor: '#222f3e',
        padding:20,
        flex:1,
        alignItems: 'center',
    }
})

export default layout
